This weeks line up! 

@delinquentewineco ‚ÄúScreaming Betty‚Äù will bring you back to summer time. 100% vermintino. Cirtus, acid, texture and a salty finish gives this wine exactly what you look for to cool off and relax.

@Lasjaraswines ‚ÄúGlou Glou‚Äù or as we call ‚Äúchug-chug‚Äù is our new in-house pizza wine. Undergoing carbonic maceration, the result is a light, fresh, chuggable chilled red with a pop of acidity.

@Vini_Controvento out of Italy makes some of our favorite skin contact wines. Their Luna Calante is 100% Montonico and resembles orange Fanta. Funky, effervescent and high acidity makes you coming back for another sip!

This weeks line up.. 

Our new rose Pet Nat Ros√© from Italy is from @ilceovini. Sryah / Merlot blend. Perfect for outdoor gatherings. Bright, dry and high acidity will make you wanting more.

@oldworldwinery makes some of our favorite chilled reds and oranges. Their L'Aureate is %100 chardonnay that‚Äôll rock your socks off. Beautiful appearance, fuller bodied, aromatic and bright

@Chateauterreforte is our current pizza wine. This Cotes Du Rhone is full bodied, higher acidity, and ripe fruit. Order it with your Fungi pizza!

