Skipped some school on Friday and ventured down to give a hand at @bontonfarms 
//
The Bonton neighborhood of Dallas is underserved and a model definition of a ‚Äòfood desert.‚Äô The rate of heart disease, diabetes, and cancers are double the rate of Dallas County. Most estimate the reason: poor nutrition, due to lack of access and food education. The closest grocery store is a three hour round trip by bus. 
//
The founders of BF knew something had to be done. What stated as a small community garden on a vacant lot has grown into so much more. Lives are being changed by the work that is going on in Bonton. 
//
I‚Äôd encourage you to check them out. Read their story. Support, if you can. Or just as important, find the BF‚Äôs in your area and go lend a hand. 
//
See and Be.

